import "./Expenses.css";
import ExpenseItem from "./ExpenseITem";
import Card from "./UI/Card";
function Expenses(props) {
  return (
    <Card className="expenses">
      <ExpenseItem e={props.expense[0]}></ExpenseItem>
      <ExpenseItem e={props.expense[1]}></ExpenseItem>
      <ExpenseItem e={props.expense[2]}></ExpenseItem>
      <ExpenseItem e={props.expense[3]}></ExpenseItem>
    </Card>
  );
}
export default Expenses;
